import React, { useState } from 'react';

const Remort = () => {
  const [count, setCount] = useState();

  return (

    <div className="card">
      <div className="card-header">
        {count}
      </div>
      <div className="card-body">

          <button
            className='btn btn-info'
            onClick={() => setCount(count + 1)}
            type="increment"
          >
            +
          </button>

          <button
            className='btn btn-danger'
            onClick={() => setCount(count - 1)}
            type="decrement"
          >
            -
          </button>


          <button
            className='btn btn-danger'
            onClick={() => setCount([])}
            type="reset"
          >
            -
          </button>

